import './Card.scss'

const Card = (props: any)=>{

    return(

        <div className='container'>
            <p>Name:{props.name}</p>
            <p className='films'>Films:{props.films}</p>
            <p>Birth:{props.birth_year}</p>
        </div>
    )

}

export default Card;
